import React from "react";
import Slider from "./Slider";
import { useStateValue } from "./StateProvider";
import "../css/Result.css";

function Result() {
  const [{ recommended }] = useStateValue();

  return (
    <div className="result">
      <div className="result-top">
        <Slider />
      </div>
      <div className="result-body">
        <div className="result-left">
          <iframe
            height="500"
            src="https://www.youtube.com/embed/tgbNymZ7vqY"
          ></iframe>
        </div>
        <div className="result-right">
          <div className="result-rightDescription">
            <h2>Title</h2>
            <p>
              Lorem, ipsum dolor sit amet consectetur adipisicing elit. Non
              laudantium beatae consequatur ipsum voluptate eos porro iusto quis
              aut est illum animi obcaecati quos aliquam quasi laboriosam,
              molestias vel. Commodi!
            </p>
          </div>
        </div>
      </div>
    </div>
  );
}

export default Result;
